import React from 'react'
import logo_inshorts from './../images/impactwise logo 2000.png'
import './NavInshorts.css'
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import HamburgerDrawer from './HamburgerDrawer'
import { useAuth0 } from "@auth0/auth0-react";
import { ForkLeft } from '@mui/icons-material';
import App from './App';

const NavInshorts = ({setCategory}) => {
  const { loginWithRedirect } = useAuth0();
  const { logout } = useAuth0();
  const { user, isAuthenticated, isLoading } = useAuth0();


  
  return (<>
    <div className='nav'>
      <div className='icon'><HamburgerDrawer setCategory={setCategory} /></div>
      <img className='logo' style={{cursor: 'pointer'}} src={logo_inshorts} height='80%' alt='logo'></img>
      
     
        {isAuthenticated ? (
    //       <a style={{marginLeft:"400px"}} target='blank' className="but">
    //       <p>Welcome <b style={{color: "blue"}} >{user.name}</b></p>
    //       <button className='button-45' onClick={() => logout({ logoutParams: { returnTo: window.location.origin } })}>
    //   Log Out
    // </button>
    // </a>
<BrowserRouter>
      <Routes>
        {/* <Route path="/" element={<Login />} /> Login route at root path */}
        <Route path="/" element={<App />} /> {/* App route at /app path */}
      </Routes>
    </BrowserRouter>
    
        )
        :(
          <a style={{marginLeft:"100px"}} target='blank' className="but">
          <button  className='button-36' onClick={() => loginWithRedirect()}>Log In</button>
          </a>
        )
      }
       
     
      
    </div>
   
    </>
  )
}

export default NavInshorts
